import React, { useState, useEffect } from 'react';
const Portfolio = () => {
    const alpha = require('alphavantage')({ key : process.env.REACT_APP_ALPHA_VANTAGE_API_KEY });

    const getValues = () => {
        let microsoft = alpha.data.intraday('msft').then(data => {
            // return data;
            console.log(Object.keys(data))
            console.log(data['Time Series (1min)'])
        });
        // const json = JSON.parse(microsoft)
        // console.log(json)
        // return microsoft;
    }

    return (
        <div>
            Hi
            {getValues()}
        </div>
    );
}
 
export default Portfolio;
